import react from "react";

function App() {
  return (
    <div className="calculatorGrid">
      <div className="output">
        <div className="previousOperand" ></div>
        <div className="currentOperand" ></div>
      </div>
      <button className="span-two">AC</button>
      <button></button>
    </div>
  );
}

export default App;
